import React from "react";
import { useEffect } from "react";
import { Button } from "./Button.js";


export const Test = () => {
    useEffect(()=>{
        fetch('https://api.trivia.willfry.co.uk/questions?categories=geography&limit=10')
             .then(res => {
                 return res.json();
             })
             .then(data => {
                 console.log(data);
             })
    }, []);

    return <Button className="test">Test</Button>;
}
